import React from 'react';
import CardList from './CardList';
import { kanji } from './kanji';
import SearchBox from './SearchBox';

const App = () => {
  return(
    <Fragment className='tc '>
      <h1>Hello Welcome to Michael's 糞っぽい Kanji Dictionary</h1>
      <SearchBox />
      <CardList kanji={kanji}/>
      {console.log('hello')}
    </Fragment>
  );
}

export default App;
